import { Link } from 'react-router-dom';

export function Header(){
    return(
        <div className="header">
        <div className="logo">Logo</div>
        <div className="menu">
        <Link to="/">Home</Link>
        <Link to="about-us">About Us</Link>
        </div>
        </div>
    )
}
